import React from "react";

export const GridItem = ({ title, text, image, alt, url }) => {
  return (
    <div>
      {title && <h1>{title}</h1>}
      {text && <p>{text}</p>}
      {image && <img src={image} alt={alt} />}
      {url && <a href={url}>Link</a>}
    </div>
  );
};

export const GridItemTitleWithMultiple = ({ title, text, image, alt, url }) => {
  return (
    <div>
      {title && <h1>{title}</h1>}
      {text && <p>{text}</p>}
      {image && <img src={image} alt={alt} />}
      {url && <a href={url}>Link</a>}
    </div>
  );
};
